/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `beforeInsertBelegteveranstaltung` BEFORE INSERT ON `BelegteVeranstaltung` FOR EACH ROW BEGIN
    /* Deklaration von Variablen f√ºr Studenten- und Veranstaltungs-Jahrgang */
    DECLARE studentJahrgang INT;
    DECLARE veranstaltungJahrgang INT;
    
    /* Abrufen des Jahrgangs des Studenten basierend auf der √ºbergebenen Matrikelnummer */
    SELECT jahrgang INTO studentJahrgang
    FROM Student
    WHERE matrikelnummer = NEW.matrikelnummer;

    /* Abrufen des Jahrgangs der Veranstaltung basierend auf der √ºbergebenen Veranstaltungs-ID */
    SELECT jahrgang INTO veranstaltungJahrgang
    FROM Veranstaltung
    WHERE veranstaltungId = NEW.veranstaltungId;

    /* Pr√ºfung ob Jahrgang angegeben wird und ob beide angaben √ºbereinstimmen */
    IF studentJahrgang IS NULL OR veranstaltungJahrgang IS NULL OR studentJahrgang != veranstaltungJahrgang THEN
        SIGNAL SQLSTATE '45000'
        SET MESSAGE_TEXT = 'Ein Student kann nur an Veranstaltungen seines Jahrgangs teilnehmen.';
    END IF;
END */;;
