/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `beforeInsertGruppeAtTermin2Gruppe` BEFORE INSERT ON `Termin2Gruppe` FOR EACH ROW BEGIN
